/** @format */
import React from 'react';

function LoadingBox() {
	return (
		<div className="text-center h-100 container">
			<link href="%PUBLIC_URL%/Spin-1s-200px.svg" className="loader" alt="loader" />
		</div>
	);
}
export const csvReport = () => {
	const adminProductList = useSelector((state) => state.adminProductList);
	const { products } = adminProductList;

	const headers = [
		{ label: 'Product Name', key: 'product' },
		{ label: 'Serial Number', key: 'serial' },
		{ label: 'Batch No', key: 'batch_no' },
		{ label: 'Pin Code', key: 'pin_code' },
		{ label: 'QR Code', key: 'QRcode' }
	];

	const csvReport = {
		data: products,
		headers: headers,
		filename: 'Products.csv'
	};
};
